import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import { useState, useEffect } from 'react';
import { toast } from 'react-toastify';
import _ from 'lodash';
const ModelUser = (props) => {
    const [firstName, setfirstName] = useState("");
    const [lastName, setlastName] = useState("");
    const [email, setemail] = useState("");
    const [phoneNumber, setphoneNumber] = useState("");
    const [address, setaddress] = useState("");
    const [password, setpassword] = useState("");

    const defaultuserData = {
        firstname: '',
        lastname: '',
        email:'',
        phone:'',
        address:'',
        password:''
    }
    const validInputsDefault = {
        validFirstname: true,
        validLastname: true,
        validEmail: true,
        validPhone:true,
        validAddress:true,
        validPassword:true
    }
    const [userData, setUserData] = useState(defaultuserData);
    const [validInputs, setValidInputs] = useState(validInputsDefault);
    const handleOnchangeInput = (value, name) => {
        let _userData = _.cloneDeep(userData);
        _userData[name] = value;
        setUserData(_userData);
    }
    const CheckvalidInputUser = () => {

    }
    return (
        <>
            <Modal size="lg" show={true} className='model-user'>
                <Modal.Header closeButton>
                    <Modal.Title id="contained-modal-title-vcenter">
                        <span>{props.title}</span>
                    </Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <div className='content-body row'>
                        <div className='col-12 col-sm-6 form-group'>
                            <label>First Name  :</label>
                            <input className= {validInputs.validFirstname ? 'form-control' : 'form-control is-invalid'}
                            type='text' value={userData.firstname}
                            onChange={(event) =>handleOnchangeInput(event.target.value, "firstname")}
                            />
                        </div>
                        <div className='col-12 col-sm-6 form-group'>
                            <label>Last Name :</label>
                            <input className='form-control ' type='text' value={userData.lastname}
                              onChange={(event) =>handleOnchangeInput(event.target.value, "lastname")}
                            />
                        </div>
                        <div className='col-12 col-sm-6 form-group'>
                            <label> Email (<span className='red'>*</span>) :</label>
                            <input className='form-control ' type='email' value={userData.email}
                              onChange={(event) =>handleOnchangeInput(event.target.value, "email")}
                            />
                        </div>
                        <div className='col-12 col-sm-6 form-group'>
                            <label>phone Number (<span className='red'>*</span>) :</label>
                            <input className='form-control ' type='number' value={userData.phone}
                              onChange={(event) =>handleOnchangeInput(event.target.value, "phone")}
                            />
                        </div>
                        <div className='col-12 col-sm-6 form-group'>
                            <label>AddRess (<span className='red'>*</span>) :</label>
                            <input className='form-control ' type='text' value={userData.address}
                              onChange={(event) =>handleOnchangeInput(event.target.value, "address")}
                            />
                        </div>
                        <div className='col-12 col-sm-6 form-group'>
                            <label>Password (<span className='red'>*</span>) :</label>
                            <input className='form-control ' type='password' value={userData.password}
                              onChange={(event) =>handleOnchangeInput(event.target.value, "password")}
                            />
                        </div>
                       
                    </div>
                </Modal.Body>
                <Modal.Footer>
                    <Button variant="secondary" onClick={props.onHide}>Close</Button>
                    <Button variant="primary" >
                        Save
                    </Button>
                </Modal.Footer>
            </Modal>

        </>
    )
}

export default ModelUser;
